import { useContext } from "react";

import Context from "../context";

export default function Favoritos() {
  const { fotos, favorite } = useContext(Context);

 /* Filtering the fotos array and returning only the ones that are in the favorite array. */
  let favorites = fotos.filter((foto) => favorite.includes(foto.id));

  return (
    <div>
      <h1>Fotos favoritas</h1>
      <div className="p-3 galeria grid-columns-4"></div>
    </div>
  );
}
